import React, { Component } from 'react'
import styled from 'styled-components'

const Circle = styled.div`
  border: 10px solid red;
  border-radius: 50%;
  width: 20px;
  height: 20px;
`

class Bar extends Component {
  render() {
    return <Circle />
  }
}

export default Bar
